import axios from "axios";
import React from "react";

const URL = "https://ccc-treasure-api.an.r.appspot.com/";

export default function App() {
  const [key, value] = React.useState(null);

  React.useEffect(() => {
    axios.get(URL).then((response) => {
      value(response.data);
    });
  }, []);

  if (!key) return null;

  return (
    <div>
      <h1>{key.treasure}</h1>
    </div>
  );
}
